// 智能合约的许可协议
// SPDX-License-Identifier: GPL-3.0-or-later

// 编译器版本
pragma solidity ^0.8.7;

contract Finance {
    
    struct Transfer {
        address from;
        address to;
        uint256 amount;
        uint256 timestamp;
    }

    Transfer[] public transfers;

    uint256 public money;   // 保存合约的总余额
    address payable owner; // 保存合约的所有者，即为部署合约的外部账户

    constructor() payable { // 合约构造函数
        owner = payable(msg.sender); // 设定智能合约的所有者
        money = msg.value;          // 初始化合约余额为部署时的转账金额
    }

    // 给指定地址转账
    function sendValue(address addr, uint256 amount) public {
        address payable addr_pay = payable(addr);
        require(amount > 0, "Amount must be greater than zero"); // 确保转账金额大于零
        uint256 amountInWei = amount * 10**18; // 将输入的 ETH 数量转换为 Wei
        require(money >= amountInWei, "Insufficient contract balance"); // 检查合约余额是否足够

        addr_pay.transfer(amountInWei); // 给指定地址转账指定金额（以 Wei 为单位）
        money -= amountInWei;       // 减少合约余额
        recordTransfer(msg.sender, addr, amountInWei); // 记录转账信息
    }

    // 获取指定地址的余额
    function getBalance(address payable addr) public view returns (uint256) {
        return addr.balance; // 返回指定地址的余额
    }

    // 给合约转账
    function deposit() public payable {
        require(msg.value > 0, "Amount must be greater than zero");
        money += msg.value; // 增加合约余额
        recordTransfer(msg.sender, address(this), msg.value); // 记录转账信息
    }

    // 记录转账信息
    function recordTransfer(address from, address to, uint256 amount) private {
        transfers.push(Transfer(from, to, amount, block.timestamp)); // 将转账信息添加到数组中
    }

    // 设置fallback函数，为payable属性，合约可以接受其他合约和账户的转账
    fallback() external payable {
        money += msg.value; // 增加合约余额
        recordTransfer(msg.sender, address(this), msg.value); // 记录转账信息
    }
                   
    receive() external payable {
        money += msg.value; // 增加合约余额
        recordTransfer(msg.sender, address(this), msg.value); // 记录转账信息
    }
}
